package Domain.Promos;

public class Promo {
	private int id;
	private String name;

	public Promo() {
		super();
		// TODO Auto-generated constructor stub
	}

	public Promo(String name) {
		super();
		this.name = name;
	}

	public int getId() {
		return id;
	}

	public void setId(int id) {
		this.id = id;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	
	
}
